  - id: NarrativeContentItem_14
    instanceType: NarrativeContentItem
    name: NCI_14
    text: <div xmlns="http://www.w3.org/1999/xhtml"><p>Previous studies of the oral
      formulation have shown that xanomeline tartrate may improve behavior and cognition.
      Effects on behavior are manifest within 2 to 4 weeks of initiation of treatment.
      The same studies have shown that 8 to 12 weeks are required to demonstrate effects
      on cognition and clinical global assessment. This study is intended to determine
      the acute and chronic effects of the TTS formulation in AD; for that reason,
      the study is of 26 weeks duration. Dosage specification has been made on the
      basis of tolerance to the xanomeline TTS in a clinical pharmacology study (H2Q-EW-LKAA),
      and target plasma levels as determined in studies of the oral formulation of
      xanomeline (H2Q-MC-LZZA).</p></div>
    uuid: 00000000-0000-4000-8000-000000001283
  - id: NarrativeContentItem_15
    instanceType: NarrativeContentItem
    name: NCI_15
    text: <div xmlns="http://www.w3.org/1999/xhtml"><p>The parallel dosing regimen
      maximizes the ability to make direct comparisons between the treatment groups.
      The use of placebo allows for a blinded, thus minimally biased, study. The placebo
      treatment group is a comparator group for efficacy and safety assessment.</p><p>Two
      interim analyses are planned for this study. The first interim analysis will
      occur when 50% of the patients have completed Visit 8 (8 weeks). If required,
      the second interim analysis will occur when 50% of the patients have completed
      Visit 12 (24 weeks).</p></div>
    uuid: 00000000-0000-4000-8000-000000001284
  - id: NarrativeContentItem_16
    instanceType: NarrativeContentItem
    name: NCI_16
    text: <div xmlns="http://www.w3.org/1999/xhtml"></div>
    uuid: 00000000-0000-4000-8000-000000001285
