    uuid: 00000000-0000-4000-8000-000000001289
  - id: NarrativeContentItem_21
    instanceType: NarrativeContentItem
    name: NCI_21
    text: "<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>For Lilly studies, the following\
      \ definitions are used:</p>\n<div>\n<div><strong>Screen</strong></div>\n<div>\n\
      <p>Screening is the act of determining if an individual meets minimum requirements\
      \ to become part of a pool of potential candidates for participation in a clinical\
      \ study.</p>\n<p>In this study, <strong>screening</strong> will include asking\
      \ the candidate preliminary questions (such as age and general health status)\
      \ and conducting invasive or diagnostic procedures and/or tests (for example,\
      \ diagnostic psychological tests, x-rays, blood draws). Patients will sign the\
      \ consent at their screening visit, thereby consenting to undergo the screening\
      \ procedures and to participate in the study if they qualify.</p>\n</div>\n\
      </div>\n<div>\n<div>To <strong>enter</strong></div>\n<div>\n<p>Patients <strong>entered</strong>\
      \ into the study are those from whom informed consent for the study has been\
      \ obtained. Adverse events will be reported for each patient who has <strong>entered</strong>\
      \ the study, even if the patient is never assigned to a treatment group (<strong>enrolled</strong>).</p></div>\n\
      </div>\n</div>\n<div>\n<div>To <strong>enroll</strong></div>\n<div>\n<p>Patients\
      \ who are enrolled in the study are those who have been assigned to a treatment\
      \ group. Patients who are entered into the study but fail to meet criteria specified\
      \ in the protocol for treatment assignment will not be enrolled in the study.</p></div>\n\
      </div>\n\n<p>At Visit 1, patients who meet the enrollment criteria of Mini-Mental\
      \ State Examination (MMSE) score of 10 to 23 (Attachment LZZT.6), Hachinski\
      \ Ischemia Score \u22644 (Attachment LZZT.8), a physical exam, safety labs,\
      \ ECG, and urinalysis, will proceed to Visit 2 and Visit 3. At Visit 3, patients\
      \ whose CNS imaging and other pending labs from Visit 1 satisfy the inclusion\
      \ criteria (Section 3.4.2.1) will be enrolled in the study. Approximately 300\
      \ patients with a diagnosis of probable mild to moderate AD will be enrolled\
      \ in the study.</p>"
    uuid: 00000000-0000-4000-8000-000000001290
